create table images
(
    id          integer default nextval('avatarts_id_seq'::regclass) not null
        constraint avatarts_pk
            primary key,
    binary_data varchar                                              not null
);

alter table images
    owner to yseehpzsgbjcje;

create unique index avatarts_id_uindex
    on images (id);

create table roles
(
    id   serial
        constraint roles_pk
            primary key,
    name varchar(100) not null
);

alter table roles
    owner to yseehpzsgbjcje;

create unique index roles_id_uindex
    on roles (id);

create table users
(
    id       serial
        constraint users_pk
            primary key,
    email    varchar(255)      not null,
    password varchar(255)      not null,
    id_role  integer default 1 not null
        constraint fk_id_role
            references roles
            on update cascade on delete cascade
);

alter table users
    owner to yseehpzsgbjcje;

create unique index users_id_uindex
    on users (id);

create table games
(
    id          serial
        constraint games_pk
            primary key,
    name        varchar(100)      not null,
    description varchar(511)      not null,
    owner       integer default 1 not null
        constraint owner_fk
            references users
            on update cascade on delete cascade,
    image       integer           not null
        constraint image_fk
            references images
            on update cascade on delete cascade,
    steamid     integer default 0 not null
);

alter table games
    owner to yseehpzsgbjcje;

create unique index games_id_uindex
    on games (id);
	
create table vote_to_game
(
    id     serial
        constraint vote_to_game_pk
            primary key,
    player integer not null
        constraint player_fk
            references users
            on update cascade on delete cascade,
    value  integer not null,
    game   integer not null
        constraint game_fk
            references games
            on update cascade on delete cascade
);

alter table vote_to_game
    owner to yseehpzsgbjcje;

create unique index vote_to_game_id_uindex
    on vote_to_game (id);

create unique index vote_to_game_player_game_uindex
    on vote_to_game (player, game);
	
create view "view_topGames"(votes, id, name, description, owner, steamid, binary_data) as
SELECT a.votes,
       a.id,
       a.name,
       a.description,
       a.owner,
       a.steamid,
       a.binary_data
FROM (SELECT sum(vtg.value)::double precision / count(*)::double precision AS votes,
             g.id,
             g.name,
             g.description,
             g.owner,
             g.steamid,
             i.binary_data
      FROM games g
               LEFT JOIN vote_to_game vtg ON g.id = vtg.game
               JOIN images i ON g.image = i.id
      GROUP BY i.id, g.id) a
ORDER BY (NULLIF(a.votes, 0::double precision))
LIMIT 10;

alter table "view_topGames"
    owner to yseehpzsgbjcje;

INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (27, 'Counter-Strike: Global Offensive', 'Counter-Strike: Global Offensive (CS: GO) expands upon the team-based action gameplay that it pioneered when it was launched 19 years ago. CS: GO features new maps, characters, weapons, and game modes, and delivers updated versions of the classic CS content (de_dust2, etc.).', 7, 30, 730);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (28, 'Dota 2', 'Every day, millions of players worldwide enter battle as one of over a hundred Dota heroes. And no matter if it''s their 10th hour of play or 1,000th, there''s always something new to discover. With regular updates that ensure a constant evolution of gameplay, features, and heroes, Dota 2 has taken on a life of its own.', 7, 31, 570);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (29, 'Lost Ark', 'Embark on an odyssey for the Lost Ark in a vast, vibrant world: explore new lands, seek out lost treasures, and test yourself in thrilling action combat in this action-packed free-to-play RPG.', 7, 32, 1599340);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (30, 'Apex Legends', 'Apex Legends is the award-winning, free-to-play Hero Shooter from Respawn Entertainment. Master an ever-growing roster of legendary characters with powerful abilities, and experience strategic squad play and innovative gameplay in the next evolution of Hero Shooter and Battle Royale.', 8, 33, 1172470);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (31, 'Team Fortress 2', 'Nine distinct classes provide a broad range of tactical abilities and personalities. Constantly updated with new game modes, maps, equipment and, most importantly, hats!', 8, 34, 440);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (32, 'ARK: Survival Evolved', 'Stranded on the shores of a mysterious island, you must learn to survive. Use your cunning to kill or tame the primeval creatures roaming the land, and encounter other players to survive, dominate... and escape!', 8, 35, 346110);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (33, 'PUBG: BATTLEGROUNDS', 'Play PUBG: BATTLEGROUNDS for free. Land on strategic locations, loot weapons and supplies, and survive to become the last team standing across various, diverse Battlegrounds. Squad up and join the Battlegrounds for the original Battle Royale experience that only PUBG: BATTLEGROUNDS', 9, 36, 578080);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (34, 'Grand Theft Auto V', 'Grand Theft Auto V for PC offers players the option to explore the award-winning world of Los Santos and Blaine County in resolutions of up to 4k and beyond, as well as the chance to experience the game running at 60 frames per second.', 9, 37, 271590);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (35, 'Rust', 'The only aim in Rust is to survive. Everything wants you to die - the island’s wildlife and other inhabitants, the environment, other survivors. Do whatever it takes to last another night.', 9, 38, 252490);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (36, 'Dead by Daylight', 'Dead by Daylight is a multiplayer (4vs1) horror game where one player takes on the role of the savage Killer, and the other four players play as Survivors, trying to escape the Killer and avoid being caught and killed.', 10, 39, 381210);
INSERT INTO public.games (id, name, description, owner, image, steamid) VALUES (37, 'Gloria Victis', 'Gloria Victis is a MMORPG with an emphasis on realism, set in a low-fantasy medieval open world. Enjoy MMO with skill-based non-target combat, open PVP with territory control, deep crafting system and player-driven economy – all that served with beautiful graphics and immersive atmosphere.', 10, 40, 327070);

